import React, { Component } from "react";

class Landing extends Component {
    render() {
        return (
        <div>
            <div>
                {/* <div className="landing-layer"> */}
                    <img className="landing-hero landing-layer" src="https://static1.squarespace.com/static/5391ec89e4b0b156e79a61d0/5a4fd1b78165f5c5be346030/5a4fd214c8302547a57dd451/1515180574243/DSCF7428-Edit.jpg"/>
                {/* </div> */}
            </div>
        </div>
        )
    }
}

export default Landing;
